28/Sep/25 10:52 AM;moalami-c;|*Comment Author*|*Comment*|*Deloitte Response 1*|
|Bassam A. Binmtar|Delivery Order to be issued by shipping agent not the port operator|Thank you for your comment - please note that the intension of this requirement in the DD is to trigger an integration with the port operator's system so as to notify them that an entry ticket is filed for these goods and they can enable the issuance of a delivery order (irrespective of which persona (e.g, shipping agent) actually issues the delivery order and in which system)|
|Bassam A. Binmtar|Data dictionary export/re-export from local market: risk assessment results from risk engine, physical goods validation, entry ticket amendment marked with "?"|Amended (question mark was typo mistake and has been removed)|;;;
